import Link from "next/link";

const Content = (props) => (
  <Link href={`./friend?name=${props.name}`}>
    <div>염재선</div>
  </Link>
);

const LinkPage = () => {
  return (
    <>
      <Content name="염재선" />
      <Link href="./Yeom">
        <div>염재선</div>
      </Link>
      <Link href="./Kang">
        <div>강수호</div>
      </Link>
      <Link href="./Kim">
        <div>김유성</div>
      </Link>
      <Link href="./another">
        <div>그외 친구들이야!</div>
      </Link>
    </>
  );
};
export default LinkPage;
